import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { GoogleAuthService } from './google-auth.service'; // Assumed service

@Component({
  selector: 'app-auth',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './auth.component.html',
  styleUrls: ['./auth.component.css']
})
export class AuthComponent {
  user: any = null; // Firebase user or similar
  items: string[] = []; // Your list of items
  message: string = '';

  constructor(private authService: GoogleAuthService) {}

  async googleSignIn() {
    try {
      this.user = await this.authService.signInWithGoogle();
      this.message = 'Successfully signed in!';
    } catch (error) {
      this.message = 'Sign-in failed';
      console.error(error);
    }
  }

  async signOut() {
    try {
      await this.authService.signOut();
      this.user = null;
      this.message = 'Successfully signed out';
    } catch (error) {
      this.message = 'Sign-out failed';
      console.error(error);
    }
  }
}
